INSERT INTO `cm_page` VALUES ('2', 'من نحن', 'من نحن', '<font face=\"tahoma,arial,helvetica,sans-serif\" size=\"3\">  نظرا لان مجال التعليم الالكتروني حديث نسبيا علاوة على انه مجال واسع ومعقد ويشتمل على مكونات عديدة ، لذا فقد تعددت تعريفات التعليم الالكتروني واختلفت الأسماء التي تطلق عليه والتي قد تستخدم أحيانا بشكل متبادل وهى في الحقيقة غير متطابقة ومن هذه المسميات: ( التعلم القائم على الكمبيوتر ، التعلم القائم على التكنولوجيات ، التعلم الموزع ، التعلم بالانترنت ، التعلم الشبكي ، التعلم القائم على الويب ، التعلم على الخط ، التعلم الافتراضي ) كما تعددت تعريفات التعليم الالكتروني إلا أن معظم هذه التعريفات  ينقصها الدقة وتعبر عن وجهة نظر واحدة أو تركز على خاصية واحدة من خصائص هذا المجال ، لذا كان من الضروري توضيح الأسس النظرية التي يقوم عليها التعليم الالكتروني .</font><p>&nbsp;</p><p><font face=\"tahoma,arial,helvetica,sans-serif\" size=\"3\">مكونات نظام التعليم الالكتروني :</font></p><p><font face=\"tahoma,arial,helvetica,sans-serif\" size=\"3\">        التعليم الالكتروني ليس فقط نظام لتوصيل المحتوي والمقررات الالكترونية ، أو نظام يستخدم أدوات ومستحدثات تكنولوجية ولكنه علم نظري تطبيقي ، ونظام تكنولوجي تعليمي كامل ، وعملية مقصودة ومحكومة ، تقوم على أساس فكري فلسفي ونظريات تربوية جديدة  يمر فيها المتعلم بخبرات مخططة ومدروسة، من خلال تفاعله مع مصادر تعلم الكترونية متعددة ومتنوعة بطريقة نظامية ومتتابعة ووفق إجراءات وأحداث تعليمية منظمه ، فى بيئات تعلم الكترونية مرنة ، قائمة على الكمبيوتر والشبكات تدعم عمليات التعلم وتسهل حدوثه فى أي وقت ومكان .</font></p><p>&nbsp;</p><p><font face=\"tahoma,arial,helvetica,sans-serif\" size=\"3\">   و يتكون نظام التعلم الالكتروني من المكونات الرئيسية التالية والتي تعمل معاً بشكل متكامل ، ومتفاعل ، لتحقيق أهداف النظام وهذه المكونات هي :</font></p><p>&nbsp;</p><p><font face=\"tahoma,arial,helvetica,sans-serif\" size=\"3\">أ- مكون النظرية والبحث :  ويشتمل على العناصر التالية : النظريات والبحوث ، المشكلات التعليمية ، الممارسات ، فلسفة نظام التعليم الالكتروني وسياسته ، التخطيط ودراسة الجدوى ، الغايات التربوية والمعايير ، التصميم والتطوير ، الموارد والدعم المالي .</font></p><p>&nbsp;</p><p><font face=\"tahoma,arial,helvetica,sans-serif\" size=\"3\">ب- مكون نظام التعلم الالكتروني : ويشتمل على  العناصر التالية : المتعلمون الفلسفة والسياسات التعليمية والمعايير ، البنية التحتية التكنولوجية وتشمل الشبكات الالكترونية ، أجهزة الكمبيوتر الخاصة بالعلماء ، الخوادم ، البرامج ، الغايات والأهداف التعليمية ، الأفراد ( أساتذة ،مبرمجون ، منسقون ، فرق الدعم والمساندة ،......) ، المحتوي الالكتروني ( برامج ومقررات الكترونية ) ، المصادر والوسائط الالكترونية ، عمليات واستراتيجيات وأساليب تعليم ، بيئات التعلم الافتراضية ، مراكز مصادر تعلم الكترونية ، مكتبات الكترونية ) ، نظام اتصالات وتفاعل ،نظام ادراة المحتوي ، نظام ادراة التعلم ويشمل ( نظام التسجيل وإدارة شئون الطلاب ، نظام إدارة الأفراد ، بيئات إدارة التعلم ) ، نظام التقدير والتقويم ، الخدمات والتسهيلات ، نظام الصيانة والدعم الفني .</font></p><p>&nbsp;</p><p><font face=\"tahoma,arial,helvetica,sans-serif\" size=\"3\">ج- مكون العمليات فى التعلم الالكتروني : ويشتمل على العديد من العمليات والتي يمكن  تصنيفها في نوعيين رئيسيين هما: عمليات التصميم والتطوير ، وعمليات الاتصال والتعليم كما يلي :</font></p><p>&nbsp;</p><p><font face=\"tahoma,arial,helvetica,sans-serif\" size=\"3\">1- عمليات التصميم والتطوير:  ويقوم بها فريق التصميم والتطوير وتتضمن عمليات ( التحليل، التصميم، التطوير، التقويم )</font></p><p>&nbsp;</p><p><font face=\"tahoma,arial,helvetica,sans-serif\" size=\"3\">2- عمليات الاتصال والتعليم والتعلم: وتتضمن ( الاتصال والوصول ، التسجيل والدخول ، استثارة الدافعية ، إدارة المحتوى والمعرفة ، التعليم الفردي ، التعليم الجماعي فى الفصول الافتراضية المتزامنة ، التعلم الجماعي فى منتديات المناقشة الالكترونية غير المتزامنة ، ( التعلم الجماعي في منتديات المناقشة الالكترونية غير المتزامنة ،عمليات الأنشطة والتدريبات العملية ، التوجيه والمساعدة ، التعزيز والرجح ، الدعم والمساندة ، التقدير والتقويم )</font></p><p>&nbsp;</p><p><font face=\"tahoma,arial,helvetica,sans-serif\" size=\"3\">د- مكون المخرجات فى نظام التعليم الالكتروني:  ويشتمل على معلمين ومتعلمين بمعارف ومهارات وأساليب تفكير واتجاهات جديدة</font></p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p><font face=\"tahoma,arial,helvetica,sans-serif\" size=\"3\">المبادئ النظرية للتعليم الالكتروني :</font></p><p>&nbsp;</p><p><font face=\"tahoma,arial,helvetica,sans-serif\" size=\"3\">        من المعروف أن النظرية مجموعة من الفروض التي تطبق على كل حالات ظاهرة معينة وتساعد في اتخاذ القرار ، وفي فلسفة التطبيق وفي التنفيذ الفاعل من خلال الممارسات وفيما يلي مجموعة من الفروض والمبادئ التي تؤسس نظريا للتعليم الالكتروني :</font></p><p>&nbsp;</p><p><font face=\"tahoma,arial,helvetica,sans-serif\" size=\"3\">1-    التعليم الالكتروني وسيط تكنولوجي لتنفيذ التعليم ويمكن تطبيقه من خلال نماذج مختلفة مثل التعليم التقليدي والتعليم عن بعد ، وفي فلسفات تربوية مختلفة مثل السلوكية والبنائية ، وهذا المبدأ لا يجعل التعليم الالكتروني شكلا محددا من أشكال التعليم ولكنه وسيط لتنفيذ التعليم .</font></p><p>&nbsp;</p><p><font face=\"tahoma,arial,helvetica,sans-serif\" size=\"3\">2-    التعليم الالكتروني أدى إلي ظهور أشكال وأنماط جديدة في التعليم تجمع بين إمكانات ونواحي القوة في التعليم التقليدي والتعليم عن بعد مثل التعليم التو ليفي .</font></p><p>&nbsp;</p><p><font face=\"tahoma,arial,helvetica,sans-serif\" size=\"3\">3-    التعليم الالكتروني يقوم على أساس مداخل التعليم واستراتيجياته وليس العكس اى أن التعليم الالكتروني يمكن تطبيقه مع المداخل والاستراتيجيات المختلفة مثل التعلم البنائي والتعلم التشاركي والتعلم الموقفي والتعلم المبني على المشكلات ، وغير ذلك</font></p><p>&nbsp;</p><p><font face=\"tahoma,arial,helvetica,sans-serif\" size=\"3\">4-    التعليم الالكتروني يقدم من خلال التنفيذ الناجح للمستحدثات التكنولوجية، بحيث يحقق كل الشروط والمتطلبات اللازمة لعملية الاستحداث التكنولوجي ليصبح جزءا من النظام.</font></p><p>&nbsp;</p><p><font face=\"tahoma,arial,helvetica,sans-serif\" size=\"3\">5-        التعليم الالكتروني يستخدم في توصيل المحتوي وعرضه، ودعم وتسهيل عملية التعليم والتعلم.</font></p><p>&nbsp;</p><p><font face=\"tahoma,arial,helvetica,sans-serif\" size=\"3\">6-        التعليم الالكتروني يحقق نجاحا أكبر إذا اختيرت أدواته بعناية، وبشكل مندمج ومتكامل ومتفاعل معه وكجزء ومكون أساس له.</font></p><p>&nbsp;</p><p><font face=\"tahoma,arial,helvetica,sans-serif\" size=\"3\">7-    التعليم الالكتروني يستهدف تنمية المتعلم في سياق المنهج والأهداف المحددة وتكنولوجيات التعليم الالكتروني هي أدوات لتنفيذ هذا المنهج.</font></p><p>&nbsp;</p><p><font face=\"tahoma,arial,helvetica,sans-serif\" size=\"3\">8-    التعليم الالكتروني له إمكاناته ومميزاته التي تبرر تنفيذه أي أن تكنولوجيا التعليم الالكتروني يمكن أن تستخدم بشكل فاعل وناجح إذا قدمت إمكانات ومميزات تعليمية مزيدة تحتاجها العملية التعليمية .</font></p><font face=\"tahoma,arial,helvetica,sans-serif\" size=\"3\"><br /></font>', '1', 'YES', 'YES', 'YES', 'YES', 'YES');
