INSERT INTO `cm_setting` VALUES ('1', 'المتحكم', 'osama@yahoo.com', 'NO', ' الموقع مغلق مؤقتاً للصيانة والتحديث. تفضل بالزيارة في وقت لاحق، شكراً                                              ', '                                            المتحكم ,اخبار,', '      محرك بوابة ديناميكية و نظام إدارة المحتوى', '                                            osama salama', 'NO', 'مرحبا بكم  مع برنامج المتحكم', '   <img src=\"http://localhost/cmslight/Media/1248177613.jpg\" align=\"right\">\r\n المتحكم العربي  هو برنامج متكامل لبناء المواقع الاحترافية والتحكم بها علي شبكة الانترنت وقد صمم خصيصا ليلبي احتياجات المواقع العربية للافراد والشركات . المتحكم يمكنك وبكل سهولة تركيب وبناء موقعك بنفسك بل والتحكم الكامل به دون الحاجة الي الإستعانه بخبراء . يتميز نظام المتحكم العربي  بدعمة لعدة لغات واستخدامه نظام القوالب في التصميمات مع لوحة تحكم سهله وقويه وذات كفاءة وأمان . صمم المتحكم خصيصاً لتقديم كل الإمكانيات اللازمة لصاحب الموقع لكى يتحكم فى موقعه بكل سهولة وبكل حرية وبدون أدنى تعقيد وستكتشف ذلك بنفسك بمجرد دخولك الى لوحة التحكم الخاصة بالمتحكم وقد وضعنا في الاعتبار أن فكرة المجلة الجاهزة تعتمد فى الأصل على التسهيل والمرونة للعميل فى ادارة موقعه وقد تحقق الحلم بفضل الله فى الجمع بين السهولة والمرونة والقوة فى أسلوب برنامج الإدارة والتعامل معه وان شاء الله سيستمر العمل على تطوير هذا المشروع العظيم آخذين فى الإعتبار ملاحظاتكم وتعليقاتكم على البرنامج حتى نصل معكم وبكم الى القمة', 'gray.css', '2', 'php', 'osama@yahoo.com', 'باعت بريد', '/usr/sbin/sendmail', 'localhost', '25', 'admin', ' admin', 'NO', '10', null, 'NO', '300', '200', 'mmmmmmmmmm', 'NO', '1316960413.wav', '-1');
